const INITIAL_STATE = {
  sections: [
    {
      title: 'ADVENTURE',
      imageUrl: './adventure.jpg',
      id: 1,
      linkUrl: 'adventure'
    },
    {
      title: 'ROADTRIP',
      imageUrl: './roadtrip.jpg',
      id: 2,
      linkUrl: ''
    },
    {
      title: 'VACATION',
      imageUrl: 'https://imgur.com/gAogIna',
      id: 3,
      linkUrl: ''
    },
    {
      title: 'TRIPS',
      imageUrl: './trips.jpg',
      size: 'large',
      id: 4,
      linkUrl: ''
    },
    {
      title: 'ACCOMMODATIONS',
      imageUrl: './accommodations.jpg',
      size: 'large',
      id: 5,
      linkUrl: ''
    }
  ]
};

const menuReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default menuReducer;
